{"about": "CV: https://thdusdl1219.github.io/files/cv.pdf

I got my Ph.D. at Georgia Tech advised by Prof. Taesoo Kim. I am strongly interested in software security, and system security. During my Ph.D., I have been working on finding bugs in complicated software such as web browsers and open-source libraries with automatic ways like fuzzing and static analysis. I am also interested in applying emerging hardware features such as Intel MPK and SGX to improve binary protection. One of my recent interests is applying machine learning for security. My recent works utilized the ML model for natural language processing to improve binary analysis.

