 "location": "Yorktown Heights, New York, United States", "description": "During my Internship with the Cyber Security Intelligence team, I pioneered the innovative application of Natural Language Processing (NLP) models to binary analysis. My focus centered on developing a tool capable of generating function embedding by leveraging data flow from LLVM Intermediate Representation (IR) in conjunction with BERT. Preliminary experimental results demonstrated that the function embedding, rooted in data flow, yielded a higher recall in identifying the most analogous function in binaries—based on cosine similarity—compared to the SOTA IR representation tool."}, {"title": "Security Engineering Intern", "company": "Microsoft", "work_type": "Internship", "start_date": "May 2020", "end_date": "Jul 2020", "location": "Redmond, Washington, United States", "description": "In my role as a Security Engineering Intern with the Platform Security Assurance & Vulnerability Research team, I executed comprehensive security assessments on kernel modules for network file systems, which involved developing a file system fuzzer built atop a full-system emulator. During the internship, I found multiple bugs, including CVE-2020-17047 and CVE-2020-17051, both of which posed a significant threat by enabling pre-authentication Remote Code Execution (RCE) within default-enabled features."}, {"title": "Research Assistant", "company": "National University of Singapore", "work_type": "Internship", "start_date": "Jan 2017", "end_date": "Jun 2017", "location": "Singapore", "description": "As a research intern under the guidance of Prof. Min-suk Kang, I developed a verifiable resource accounting system to enhance cloud services, employing both hardware and software isolation techniques."}, {"title": "Research Assistant", "company": "Pohang University of Science and Technology", "work_type": "Internship", "start_date": "Feb 2016", "end_date": "Jul 2016", "location": "Pohang, North Gyeongsang, South Korea", "description": "During my internship under the mentorship of Prof. Hanjun Kim, I contributed to the implementation of a unified IoT development platform."}], "headline": "Senior Software Engineer @ Samsung Research America | Cybersecurity", "id": "https://www.linkedin.com/in/soyeon-park-71415b118/", "location": "Kirkland, Washington, United States", "name": "Soyeon Park", "profile_pic": "https://media.licdn.com/dms/image/v2/D5603AQFAteduS6eTHQ/profile-displayphoto-shrink_800_800/profile-displayphoto-shrink_800_800/0/1667849809144?e=1749081600&v=beta&t=Zv760W9JXzc7CNIh9ftkGuQOkhla-KfofOoauO6wouw"}

